import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import icon from './icon.png';
import Socials from './socials.js';
import Button from '@material-ui/core/Button';
//import logo from './logo.svg';

class Projects extends Component {

  render() {
  return (
    <div>
      <div>
        <div style={{position: 'absolute', top: '10px', alignContent: 'center', left: '50%', marginLeft: '-121px'}}>
      <Link to='/' style={{textDecoration: "none"}}>
      <img src={icon} style={{height: '125px', bottom: '20px', zIndex: '2', marginRight: '20px', marginTop: '-2px', marginBottom: '20px'}}></img>
      <div style={{margin: '20px'}}>
        <Link to='/' style={{textDecoration: "none"}}><Button className="navbar" style={{marginLeft: '10px', marginRight: '10px'}}>Home</Button></Link>
        <Link to='/about' style={{textDecoration: "none"}}><Button className="navbar" style={{marginLeft: '10px', marginRight: '10px'}}>About Me</Button></Link>
          <Button style={{marginLeft: '10px', marginRight: '10px', color: '#ff0d4d'}}>Projects</Button>
          <Link to='/resume' style={{textDecoration: "none"}}><Button className="navbar" style={{marginLeft: '10px', marginRight: '10px'}}>Resume</Button></Link>
        </div>
      {/* <img src={icon} style={{height: '125px', bottom: '20px', zIndex: '2', marginRight: '20px', marginTop: '-2px'}}></img> */}
      </Link>
      </div>
        </div>
    <div style={{backgroundColor: '#ff0d4d'}}>
        <h1>My projects!
        </h1>
    </div>
    <div style={{backgroundColor: '#ff0d4d'}}>
        <h1>My other project
        </h1>
    </div>
    <div style={{zIndex: '3', position: 'absolute', bottom: '10px', left: '50%', marginLeft: '-66px'}}>
          <Socials/>
        </div>

    </div>
  );
  }
}


export default Projects;
